[{"location":"#NaturalEarth","page":"Home","title":"NaturalEarth","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for NaturalEarth.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"#NaturalEarth.bathymetry","page":"Home","title":"NaturalEarth.bathymetry","text":"bathymetry(contour::Int = 2000)\n\nConvenient acccess to ocean bathymetry datasets. Currently tested on: https://www.naturalearthdata.com/downloads/10m-physical-vectors/10m-bathymetry/\n\nThe function returns a MultiPolygon describing the bathymetry at a given depth contour. The following depths should be available: [10000, 9000, 8000, 7000, 6000, 5000, 4000, 3000, 2000, 1000, 200, 0]\n\n\n\n\n\n","category":"function"},{"location":"#NaturalEarth.naturalearth-Tuple{String}","page":"Home","title":"NaturalEarth.naturalearth","text":"naturalearth(name::String; version = v\"5.1.2\")\nnaturalearth(name::String, scale::Int; version = v\"5.1.2\")\n\nLoad a NaturalEarth dataset as a GeoJSON.FeatureCollection object.\n\nThe name should not include the ne_ prefix, and if providing a scale should also not include a scale.  No suffix should be added.\n\nFor example, to get the ne_110m_admin_0_countries dataset, you could use:\n\nnaturalearth(\"admin_0_countries\", 110)\nnaturalearth(\"110m_admin_0_countries\")\n\nWe aim to support all datasets listed in https://github.com/nvkelso/natural-earth-vector/tree/master/geojson.\n\nwarning: Warning\nThis function downloads files from the Internet when not found locally.\n\n\n\n\n\n","category":"method"}]
